  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Streets and Sanitation
  (DSS) investigates and remedies reported violations of Chicagou2019s sanitation
  code. Residents may request service for violations such as overflowing dumpsters
  and garbage in the alley. This metric tracks the average number of days the DSS
  takes to complete sanitation code violation requests per week. Median days to complete
  requests as well as total number of requests fulfilled per week are available by
  mousing over columns. Currently the performance target for completing sanitation
  code violation requests is 3 days. For more information on sanitation code complaints,
  see https://data.cityofchicago.org/d/me59-5fac\",\n\t\"license_title\": \"License
